import React from 'react';

interface MyVideoProps {
	key: number,
	title: string;
}

class MyVideo extends React.Component<MyVideoProps> {
render() {
	const { key, title } = this.props;

	return(
		<button>[{key}] {title}</button>
		)
}

}

export default MyVideo;
